import { services } from '../../assets/dummy.js' 

export const AdminDashboard = () => {
  return (
    <div className="flex flex-col items-center justify-center gap-8 h-full w-full py-20 p-10">
    <div title="Add a service" className="border-4 border-white hover:border-2 fixed bottom-5 right-5 bg-black text-white w-10 h-10 flex justify-center items-center cursor-pointer border-transparent rounded-full">
      +
    </div>

        {services.map(service => (
        <div className="bg-black w-full rounded-lg h-20 text-white flex justify-center items-center text-xs md:text-sm max-w-md relative">
          {service.title}

          <div title="Delete a service" className="border-4 border-white hover:border-2 bg-black text-white w-10 h-10 flex justify-center items-center cursor-pointer border-transparent rounded-full">
      -
    </div>

        </div>
        ))}
  </div>
  )
}
